var $bm_rt;
var damping, elasticity, speedLimit, bounce, tempsClefProx, tempsDebut, tempsDebut, temps, spring, spring;
var fx = effect('Transform Spring');
damping = fx(2).value;
elasticity = fx(1).value;
speedLimit = 0.1;
bounce = fx(3).value;
var result = value;
if (numKeys > 1 && elasticity != 0 && nearestKey(time).index != 1 && length(velocity) <= speedLimit) {
    tempsClefProx = nearestKey(time).time;
    if (tempsClefProx <= time) {
        tempsDebut = tempsClefProx;
    } else {
        tempsDebut = key($bm_sub(nearestKey(time).index, 1)).time;
    }
    temps = $bm_sub(time, tempsDebut);
    spring = $bm_mul(velocityAtTime($bm_sub(tempsDebut, thisComp.frameDuration)), $bm_div($bm_mul($bm_div(0.15, elasticity), Math.sin($bm_mul($bm_mul($bm_mul(elasticity, temps), 2), Math.PI))), Math.exp($bm_mul(temps, damping))));
    if (speedLimit > 0)
        spring = $bm_mul(spring, $bm_sub(1, $bm_div(length(velocity), speedLimit)));
    if (!bounce)
        result = $bm_sum(valueAtTime(tempsDebut), spring);
    if (bounce && valueAtTime(tempsDebut - thisComp.frameDuration) > valueAtTime(tempsDebut))
        result = $bm_sum(valueAtTime(tempsDebut), Math.abs(spring));
    if (bounce && valueAtTime(tempsDebut - thisComp.frameDuration) < valueAtTime(tempsDebut))
        result = $bm_sub(valueAtTime(tempsDebut), Math.abs(spring));
}
$bm_rt = result;

